To add A6 and 69 in base-11, we first add the rightmost digits, which are 6 and 9. Since 6+9=15, we write down 5 and carry over 1 to the next place. Now, we add A (which is 10 in base-10) and 6, and then add the carry-over 1. So, 10+6+1=17. Since 17 is greater than 10, we write down 7 and carry over 1 to the next place. Finally, we add the carry-over 1 to 0, which gives us 1.

So, A6+69 in base-11 is equal to 175 in base-11.

\boxed{175}
